    body: '{"messages": [{"role": "user", "content": "-Goal-\nGiven a text document
      that is potentially relevant to this activity and a list of entity types, identify
      all entities of those types from the text and all relationships among the identified
      entities.\nUse English as output language.\n\n-Steps-\n1. Identify all entities.
      For each identified entity, extract the following information:\n- entity_name:
      Name of the entity, use same language as input text. If English, capitalized
      the name.\n- entity_type: One of the following types: [organization,person,geo,event,category]\n-
      entity_description: Comprehensive description of the entity''s attributes and
      activities\nFormat each entity as (\"entity\"<|><entity_name><|><entity_type><|><entity_description>)\n\n2.
      From the entities identified in step 1, identify all pairs of (source_entity,
      target_entity) that are *clearly related* to each other.\nFor each pair of related
      entities, extract the following information:\n- source_entity: name of the source
      entity, as identified in step 1\n- target_entity: name of the target entity,
      as identified in step 1\n- relationship_description: explanation as to why you
      think the source entity and the target entity are related to each other\n- relationship_strength:
      a numeric score indicating strength of the relationship between the source entity
      and target entity\n- relationship_keywords: one or more high-level key words
      that summarize the overarching nature of the relationship, focusing on concepts
      or themes rather than specific details\nFormat each relationship as (\"relationship\"<|><source_entity><|><target_entity><|><relationship_description><|><relationship_keywords><|><relationship_strength>)\n\n3.
      Identify high-level key words that summarize the main concepts, themes, or topics
      of the entire text. These should capture the overarching ideas present in the
      document.\nFormat the content-level key words as (\"content_keywords\"<|><high_level_keywords>)\n\n4.
      Return output in English as a single list of all the entities and relationships
      identified in steps 1 and 2. Use **##** as the list delimiter.\n\n5. When finished,
      output <|COMPLETE|>\n\n######################\n-Examples-\n######################\nExample
      1:\n\nEntity_types: [person, technology, mission, organization, location]\nText:\nwhile
      Alex clenched his jaw, the buzz of frustration dull against the backdrop of
      Taylor''s authoritarian certainty. It was this competitive undercurrent that
      kept him alert, the sense that his and Jordan''s shared commitment to discovery
      was an unspoken rebellion against Cruz''s narrowing vision of control and order.\n\nThen
      Taylor did something unexpected. They paused beside Jordan and, for a moment,
      observed the device with something akin to reverence. \u201cIf this tech can
      be understood...\" Taylor said, their voice quieter, \"It could change the game
      for us. For all of us.\u201d\n\nThe underlying dismissal earlier seemed to falter,
      replaced by a glimpse of reluctant respect for the gravity of what lay in their
      hands. Jordan looked up, and for a fleeting heartbeat, their eyes locked with
      Taylor''s, a wordless clash of wills softening into an uneasy truce.\n\nIt was
      a small transformation, barely perceptible, but one that Alex noted with an
      inward nod. They had all been brought here by different paths\n################\nOutput:\n(\"entity\"<|>\"Alex\"<|>\"person\"<|>\"Alex
