      [\"Trade agreements\", \"Tariffs\", \"Currency exchange\", \"Imports\", \"Exports\"]\n}}\n#############################\nExample
      2:\n\nQuery: \"What are the environmental consequences of deforestation on biodiversity?\"\n################\nOutput:\n{{\n  \"high_level_keywords\":
